import React, { Component } from "react";
import { BrowserRouter, Switch, Route, Redirect, Link } from "react-router-dom";
import { SignIn } from "./signin";
import { SignUp } from "./signup";
import { Test } from "./test";

export class Home2 extends Component {
  render() {
    return (
      <div>
        {window.location.href == "http://localhost:3000/" && (
          <div className="mainhome">
            <title>Covid-19 Patient Monitor</title>
            <div>
              <header className="heading">
                Covid-19 Patient Monitor System
              </header>
              <br></br>
              <div className="description">
                Welcome ! This system allows doctors to monitor vital
                information about a patient. Patients can provide their details
                to the server , and admins can managae these profiles
              </div>
            </div>
            <div className="signin">
              Have an account? Log in
              {/* <button className="in" onClick={signin} >SIGN IN</button> */}
              <Link to="/signinsex" className="in">
                Sign In
              </Link>
            </div>
            <div className="signup">
              Dont have an account? Sign up!
              {/* <button className="in">SIGN UP</button> */}
              <Link to="/signup" className="in">
                Sign Up
              </Link>
            </div>
          </div>
        )}
      </div>
    );
  }
}
